using SOE.Core;
using SOE.Interfaces;
using SOE;
using Gateway.Login;

namespace Gateway.MapChat
{
    public class ChatSystem
    {
        public static void SendQuickChatPacket(SOEClient soeClient)
        {
            //TODO
            LoginManager.SendTunneledClientPacket(soeClient, LoginManager.StringToByteArray(/* QuickChatSendDataPacket */""));
        }

        public static void SendPacketChat(SOEClient soeClient, ushort messageType, ulong guid2, string message, string targetFirst, string targetLast)
        {
            var packetChat = new SOEWriter((ushort)BasePackets.BaseChatPacket, true);
            packetChat.AddHostUInt16((ushort)BaseChatPackets.PacketChat);

            packetChat.AddHostUInt16(messageType);
            packetChat.AddHostInt64(LoginManager.PlayerData.PlayerGUID); // Sender's Character GUID
            packetChat.AddHostUInt64(guid2);

            packetChat.AddHostInt32(LoginManager.PlayerData.Unknown24);
            packetChat.AddHostInt32(LoginManager.PlayerData.Unknown25);
            packetChat.AddHostInt32(LoginManager.PlayerData.Unknown26);
            packetChat.AddASCIIString(LoginManager.PlayerData.FirstName);
            packetChat.AddASCIIString(LoginManager.PlayerData.LastName);

            packetChat.AddHostInt32(0);
            packetChat.AddHostInt32(0);
            packetChat.AddHostInt32(0);
            packetChat.AddASCIIString(targetFirst);
            packetChat.AddASCIIString(targetLast);

            packetChat.AddASCIIString(message);

            packetChat.AddFloat(1.0f);
            packetChat.AddFloat(1.0f);
            packetChat.AddFloat(1.0f);
            packetChat.AddFloat(1.0f);


            packetChat.AddHostUInt64(0);
            packetChat.AddHostUInt32(2);
            if (messageType == 8)
                packetChat.AddHostUInt32(0);
            LoginManager.SendTunneledClientPacket(soeClient, packetChat.GetRaw());
        }

        public static void SendQuickChatSendChatToChannelPacket(SOEClient soeClient, int commandId, short channelId, long guildGuid)
        {
            var quickChatPacket = new SOEWriter((ushort)BasePackets.BaseQuickChatPacket, true);

            quickChatPacket.AddHostUInt16((ushort)BaseQuickChatPackets.QuickChatSendChatToChannelPacket);

            quickChatPacket.AddHostInt32(commandId);
            quickChatPacket.AddHostInt64(LoginManager.PlayerData.PlayerGUID);

            // UnknownStruct3
            quickChatPacket.AddHostInt32(LoginManager.PlayerData.Unknown24);
            quickChatPacket.AddHostInt32(LoginManager.PlayerData.Unknown25);
            quickChatPacket.AddHostInt32(LoginManager.PlayerData.Unknown26);
            quickChatPacket.AddASCIIString(LoginManager.PlayerData.FirstName);
            quickChatPacket.AddASCIIString(LoginManager.PlayerData.LastName);

            quickChatPacket.AddHostInt16(channelId);
            quickChatPacket.AddHostInt32(0);
            quickChatPacket.AddHostInt64(guildGuid);

            LoginManager.SendTunneledClientPacket(soeClient, quickChatPacket.GetRaw());
        }

        public static void HandleBaseChatPacket(SOEClient soeClient, SOEReader reader)
        {
            var subOpCode = reader.ReadHostUInt16();
            //_log.Debug($"HandleBaseChatPacket:\n\t- Client ID: {soeClient.GetClientID()}\n\t - SubOpCode: {subOpCode}");
            switch (subOpCode)
            {
                case (ushort)BaseChatPackets.PacketChat:
                    HandlePacketChat(soeClient, reader);
                    break;
                case (ushort)BaseChatPackets.ChatPacketEnterArea:
                    break;
                case (ushort)BaseChatPackets.ChatPacketDebugChat:
                    break;
                case (ushort)BaseChatPackets.ChatPacketFromStringId:
                    break;
                case (ushort)BaseChatPackets.TellEchoPacket:
                    break;
            }
        }

        public static void HandlePacketChat(SOEClient soeClient, SOEReader reader)
        {
            ushort messageType = reader.ReadHostUInt16();
            ulong _ = reader.ReadHostUInt64(); // guid1
            ulong guid2 = reader.ReadHostUInt64();

            for (int i = 0; i < 3; i++)
                reader.ReadHostInt32(); // unknown in player information struct
            string _2 = reader.ReadASCIIString(); // Sender First Name
            string _3 = reader.ReadASCIIString(); // Sender Last Name

            for (int i = 0; i < 3; i++)
                reader.ReadHostInt32(); // unknown in player information struct
            string targetFirstName = reader.ReadASCIIString();
            string targetLastName = reader.ReadASCIIString();

            string message = reader.ReadASCIIString();

            float[] position = new float[4];
            for (int i = 0; i < 4; i++)
                position[i] = reader.ReadSingle();

            ulong _4 = reader.ReadHostUInt64(); // Unknown
            int _5 = reader.ReadHostInt32(); // Unknown

            int? _6; // ChannelId
            if (messageType == 8)
                _6 = reader.ReadHostInt32();

            SendPacketChat(soeClient, messageType, guid2, message, targetFirstName, targetLastName);
        }

        public static void HandleBaseQuickChatPacket(SOEClient soeClient, SOEReader reader)
        {
            var subOpCode = reader.ReadHostUInt16();

            switch (subOpCode)
            {
                case (ushort)BaseQuickChatPackets.QuickChatSendChatToChannelPacket:
                    HandleQuickChatSendChatToChannelPacket(soeClient, reader);
                    break;
            }
        }

        public static void HandleQuickChatSendChatToChannelPacket(SOEClient soeClient, SOEReader reader)
        {
            var commandId = reader.ReadHostInt32();
            _ = reader.ReadHostInt64();

            // UnknownStruct3
            _ = reader.ReadHostInt32();
            _ = reader.ReadHostInt32();
            _ = reader.ReadHostInt32();
            _ = reader.ReadASCIIString();
            _ = reader.ReadASCIIString();

            var channelId = reader.ReadHostInt16();
            _ = reader.ReadHostInt32();
            var guildGuid = reader.ReadHostInt64();

            SendQuickChatSendChatToChannelPacket(soeClient, commandId, channelId, guildGuid);
        }

    }
}
